Texans have had to bear the brunt of open borders, rampant crime, and deadly fentanyl for the past four years. 
 
Making America Safe Again isn't just a campaign slogan. 
 
@POTUS & DHS @Sec_Noem are doing important work to keep Texans safe, and they know they have a steadfast partner in me.

While every state became a border state during the Biden admin, there are costs that Texas alone had to shoulder.
 
It's fair & just for TX taxpayers to be reimbursed for efforts to secure the border after Biden's dereliction of duty.
 
@GregAbbott_TX, @SenTedCruz, Texas’ GOP House delegation, & I are fighting to get this done.https://t.co/qVGXBsXNEN

PEPFAR which provides antiviral drugs to HIV/AIDS victims has saved millions of lives, including during the first Trump administration. 
 
Failure to support this program would risk ceding that leadership to adversaries like China in Africa.
 
@RobertKennedyJr said he “absolutely” supports PEPFAR, & we will work together to strengthen the program.

The federal government is responsible for border security, but when Biden failed, Texas stepped into the gap.

@GovAbbott has asked Congress to repay TX for its border enforcement costs & I support this request. 
 
The Texas congressional delegation is fighting to get Texas taxpayers the money they’re rightfully owed.

